1⃣ الألوفيرا لوشن : يعدل الهرمونات، ويرذب البشره ويحميها من الجفاف
2⃣ صابونة آلافاكادو 🥑 : مصنوع من زبدة الأفوكادو الخاصة والألوة, يرطب وينظف البشرة ويعيد لها حيويتها ونضارتها يناسب جميع أنواع البشرة، يغسل الوجه بها مرتين في اليوم
3⃣ الوفيرا جيلي : عبارة عن جل سميك تدهن به البشرة فعال على الحروق الطفيفة وحب الشباب,الاكزيما, والحساسية الجلدية، يدهن به الوجه صباحا و عصرا
4⃣ كريم الو بروبليس : ممتاز في محاربة حب الشباب والندوب التي تسببها أشعة الشمس ويساهم في توحيد لون البشرة مثالي لإزالة التجاعيد ويقشر ويزيل الخلايا الميتة يرطب البشرة ويساعد في مقاومة توسع مسامه، يدهن به الوجه في الليل.لايك وفولو ياحلويين 
